func copyToClipboard(text string, btnId string) templ.ComponentScript {
	return templ.ComponentScript{
		Name: `__templ_copyToClipboard_cdff`,
		Function: `function __templ_copyToClipboard_cdff(text, btnId){navigator.clipboard.writeText(text).then(() => {
		const btn = document.getElementById(btnId);
		const originalText = btn.innerText;
		btn.innerText = 'Copied!';
		btn.classList.add('bg-green-600', 'hover:bg-green-700');
		btn.classList.remove('bg-yellow-600', 'hover:bg-yellow-700');
		
		setTimeout(() => {
			btn.innerText = originalText;
			btn.classList.remove('bg-green-600', 'hover:bg-green-700');
			btn.classList.add('bg-yellow-600', 'hover:bg-yellow-700');
		}, 2000);
	});
}`,
		Call:       templ.SafeScript(`__templ_copyToClipboard_cdff`, text, btnId),
		CallInline: templ.SafeScriptInline(`__templ_copyToClipboard_cdff`, text, btnId),
	}
}

